const Post = ({ id }) => {
    return (
        <h1>Post Page #{id}</h1>
    )
}

export async function getServerSideProps({ query }) {
    console.log(query)
    return {
        props: { id: query.id }, // will be passed to the page component as props
    }
}

export default Post;
